import React from 'react';
import './App.css';
import './Todolist'
import {Todolist} from "./Todolist";

function App() {
    const task1 = [
        { id: 1, title: "HTML&CSS"}
    ]
    return (
        <div className="App">
            <Todolist title={'Title 1'}/>
            <Todolist title={'Title 2'}/>
        </div>
    );
}


export default App
